import { Container, Row, Col, Button } from 'react-bootstrap'
import background from '../images/pexels-chan-walrus-958545 (1).jpg'
import Cards from './Cards'
import { useEffect, useState } from 'react'
import axios from 'axios'
import { useDispatch, useSelector } from 'react-redux'
import { getResdetails } from '../redux/restuarantsSlice'



function Home() {
    const dispatch = useDispatch()
    const [details, setDetails] = useState('')
    useEffect(() => {
        getRestuarants()
    }, [])

    console.log(details);
    const isAuth = useSelector((state) => state.resisAuth);
    const getRestuarants = async () => {
        try {
            console.log('Res ------------------->')
            const res = await axios.get('http://localhost:5000/getAllres')
            dispatch(getResdetails(res.data))
        } catch (error) {
            alert(error.message)
        }
    }










    return (
        <div>
            <Container fluid>
                <Row>
                    <Col className='p-0'>
                        <div className='background-img'>
                            <img src={background} alt="" />
                            <div className='content-back'>
                                <div className='abslt-cnt'>

                                    <h2>Let food be thy medicine and   <br /> medicine
                                        be thy food</h2>
                                    <h5>
                                        Although the skills arenâ€™t hard to learn, finding the happiness <br /> and finding the satisfaction and finding fulfillment <br /> in continuously serving somebody else something good to eat
                                    </h5>
                                </div>
                                <div>
                                    <Button variant="warning">Book online</Button>{' '}
                                    <Button variant="outline-warning">See More</Button>{' '}
                                </div>

                            </div>
                        </div>


                    </Col>
                </Row>
                <Row>
                    {details &&
                        details.resdata.map((element, index) => {
                            <Col lg={4} md={6} key={index}>
                                <div className='card-par'>
                                    <Cards name={element.name} img={element.photograph} neighborhood={element.neighborhood} Address={element.address} />
                                </div>
                            </Col>
                        })
                    }

                </Row>


            </Container >
        </div>
    )
}

export default Home
